const INITIAL_STATE = {
    recursos: [
        {
            'id': 1,
            'nombre': 'nombre recurso 1',
            'url': 'path 1',
            'tamano' : '1kb'
        },
        {
            'id': 2,
            'nombre': 'nombre recurso 2',
            'url': 'path 1',
            'tamano' : '1kb'
        },
        {
            'id': 3,
            'nombre': 'nombre recurso 3',
            'url': 'path 1',
            'tamano' : '1kb'
        },
        {
            'id': 4,
            'nombre': 'nombre recurso 4',
            'url': 'path 1',
            'tamano' : '1kb'
        },
    ],
    lastId: 4
};

export default (state = INITIAL_STATE, action) => {
    switch (action.type) {
        case 'traer_recursos':
            return { ...state, recursos: action.payload }
        case 'crear_recurso':
            return {
                ...state,
                recursos: action.payload
            }
        case 'editar_recurso':
            return {
                ...state,
                recursos: action.payload
            }
        case 'eliminar_recurso':
            return {
                ...state,
                recursos: action.payload
            }
        default:
            return state;
    }
}
